function Paticipants({name,isOK}){
  if(isOK){
    return(
      <li>{name}さんはお酒が飲めます。⭕️</li>
    )
  }
  else{
    return(
      <li>{name}さんはお酒が飲めません。❌</li>
    )
  }
}
